/* ******************************************************************** */ 
/*                                GENERALS                              */
/* ******************************************************************** */
body {margin:0;  padding:0;  text-align:left; background:url(/images/bg-body.jpg) repeat-x top #fff; } 
.center {display: block;  width:1100px; margin:0 auto;} 

a img {
	border:none;
}

@font-face {
    font-family: 'charis_silregular';
    src: url('/fonts/charissilr-webfont.eot');
    src: url('/fonts/charissilr-webfont.eot?#iefix') format('embedded-opentype'),
         url('/fonts/charissilr-webfont.woff') format('woff'),
         url('/fonts/charissilr-webfont.ttf') format('truetype'),
         url('/fonts/charissilr-webfont.svg#charis_silregular') format('svg');
    font-weight: normal;
    font-style: normal;
}

@font-face {
    font-family: 'charis_silitalic';
    src: url('/fonts/charissili-webfont.eot');
    src: url('/fonts/charissili-webfont.eot?#iefix') format('embedded-opentype'),
         url('/fonts/charissili-webfont.woff') format('woff'),
         url('/fonts/charissili-webfont.ttf') format('truetype'),
         url('/fonts/charissili-webfont.svg#charis_silitalic') format('svg');
    font-weight: normal;
    font-style: normal;
}

@font-face {
    font-family: 'charis_silbold';
    src: url('/fonts/charissilb-webfont.eot');
    src: url('/fonts/charissilb-webfont.eot?#iefix') format('embedded-opentype'),
         url('/fonts/charissilb-webfont.woff') format('woff'),
         url('/fonts/charissilb-webfont.ttf') format('truetype'),
         url('/fonts/charissilb-webfont.svg#charis_silbold') format('svg');
    font-weight: normal;
    font-style: normal;
}

@font-face {
    font-family: 'charis_silbold_italic';
    src: url('/fonts/charissilbi-webfont.eot');
    src: url('/fonts/charissilbi-webfont.eot?#iefix') format('embedded-opentype'),
         url('/fonts/charissilbi-webfont.woff') format('woff'),
         url('/fonts/charissilbi-webfont.ttf') format('truetype'),
         url('/fonts/charissilbi-webfont.svg#charis_silbold_italic') format('svg');
    font-weight: normal;
    font-style: normal;
}

@font-face {
    font-family: 'museo_sans100';
    src: url('/fonts/museosans-100-webfont.eot');
    src: url('/fonts/museosans-100-webfont.eot?#iefix') format('embedded-opentype'),
         url('/fonts/museosans-100-webfont.woff') format('woff'),
         url('/fonts/museosans-100-webfont.ttf') format('truetype'),
         url('/fonts/museosans-100-webfont.svg#museo_sans100') format('svg');
    font-weight: normal;
    font-style: normal;
}

@font-face {
    font-family: 'museo_sans300';
    src: url('/fonts/museosans-300-webfont.eot');
    src: url('/fonts/museosans-300-webfont.eot?#iefix') format('embedded-opentype'),
         url('/fonts/museosans-300-webfont.woff') format('woff'),
         url('/fonts/museosans-300-webfont.ttf') format('truetype'),
         url('/fonts/museosans-300-webfont.svg#museo_sans300') format('svg');
    font-weight: normal;
    font-style: normal;
}

@font-face {
    font-family: 'museo_sans500';
    src: url('/fonts/museosans_500-webfont.eot');
    src: url('/fonts/museosans_500-webfont.eot?#iefix') format('embedded-opentype'),
         url('/fonts/museosans_500-webfont.woff') format('woff'),
         url('/fonts/museosans_500-webfont.ttf') format('truetype'),
         url('/fonts/museosans_500-webfont.svg#museo_sans500') format('svg');
    font-weight: normal;
    font-style: normal;
}

@font-face {
    font-family: 'museo_sans700';
    src: url('/fonts/museosans_700-webfont.eot');
    src: url('/fonts/museosans_700-webfont.eot?#iefix') format('embedded-opentype'),
         url('/fonts/museosans_700-webfont.woff') format('woff'),
         url('/fonts/museosans_700-webfont.ttf') format('truetype'),
         url('/fonts/museosans_700-webfont.svg#museo_sans700') format('svg');
    font-weight: normal;
    font-style: normal;
}

@font-face {
    font-family: 'HelveticaNeueLT57CnRegular';
    src: url('/fonts/helvetica57-webfont.eot');
    src: url('/fonts/helvetica57-webfont.eot?#iefix') format('embedded-opentype'),
         url('/fonts/helvetica57-webfont.woff') format('woff'),
         url('/fonts/helvetica57-webfont.ttf') format('truetype'),
         url('/fonts/helvetica57-webfont.svg#HelveticaNeueLT57CnRegular') format('svg');
    font-weight: normal;
    font-style: normal;
}

strong.all-caps {
	text-transform:uppercase;
}

.pic-captions {
	width:314px;
	min-height:208px;
	float:left;
	text-align:center;
	background-color:#333;
	padding-bottom:5px;
}

.pic-captions span{
	text-transform:uppercase;
	font-family: 'HelveticaNeueLT57CnRegular';
	color:#FFF;
}

/* ******************************************************************** */ 
/*                                HEADER                                */
/* ******************************************************************** */ 
#header-content {position:relative;  width:100%; display:block; clear:both;} 
.header {height:190px; width:1080px; display:block; margin:0 auto;} 
.header a.logo {display:block; float: left; margin:0; padding:0;} 

.main-menu 
{
	display:block; 
	float:left; 
/*	margin:68px 0 0 10px;  */
	margin:72px 0 0 10px; 
	padding:0; 
	width:565px;
}
.main-menu ul {display:block; float:right; margin:0 10px 0 0; padding:0;}
.main-menu ul li 
{
	display:block; 
	float:left; 
	margin:0; 
	padding:10px 15px; 
/*	font-family: 'charis_silregular';  */
	font-family: Helvetica, "Trebuchet MS", Arial,sans-serif;
	font-size:18px;
}
.main-menu ul li a {color:#542a04; text-decoration: none;}
.main-menu ul li a:hover,
.main-menu ul li a.current {color:#311724; text-decoration: underline;}

.social-media {display:block; float:left; margin:80px 0 0 0; padding:0;}
.social-media a {display:block; float:left; margin:0 0 0 5px; padding:0; width:30px; height:30px; background-position: left bottom; background-repeat:no-repeat;}
.social-media a span {display:none;}
.social-media a:hover {background-position: left top;}
.social-media a.twitter {background-image: url(/images/ico-twitter.png)}
.social-media a.facebook {background-image: url(/images/ico-facebook.png)}
.social-media a.google {background-image: url(/images/ico-google.png)}
.social-media a.instagram {background-image: url(/images/ico-instagram.png)}

.head-bot {height:50px; width:1080px; display:block; float:left; margin:5px auto 0 auto; background:#e4e6ea;} 
.head-bot h3 { display:block; float:left; font-family: 'charis_silregular'; color:#00ABC7; margin: 15px 15px 0 15px; font-size:20px; line-height:20px; font-weight: normal;}
.head-bot h3 span{ font-family: 'charis_silregular'; color:#666; font-size:11px; line-height:20px;}
.opentable form { display: block; float: left; width: 700px; margin:-4px 15px 0 15px; padding:0; position:relative;}
.opentable form  h2,
.opentable form  p{ display: none;}
.opentable form  div dl dt,
.opentable form  div dl dd {display: block; float: left; margin: 0; padding: 0; width:125px;}
.opentable form  div dl dt select, 
.opentable form  div dl dt input,
.opentable form  div dl dd select, 
.opentable form  div dl dd input { border: medium none #666666; display: block; float: left; height: 24px; line-height: 24px; margin: 0 40px 0 5px; padding-left: 5px; width: 103px; font-family: 'charis_silregular'; color:#222; font-size:12px;}

.opentable form  div dl dd#OT_restaurant select { width:210px;}

.opentable form  div dl dd#OT_restaurant { margin: 0 70px 0 5px; padding-left: 5px; width: 155px; font-family: 'charis_silregular'; color:#222; font-size:12px;}

.opentable form div dl dt#OT_restaurantLbl { display:none;}

.opentable form div dl#OT_defList {width:850px;}

.opentable form  div dl dt#OT_partySizeLbl { background:url(/images/ico-people.png) no-repeat left center; display: block;
 float: left;  height: 25px; text-indent: -100000px; width: 25px;}
.opentable form  div dl dt#OT_dateLbl { background:url(/images/ico-day.png) no-repeat left center; display: block;
 float: left;  height: 25px; text-indent: -100000px; width: 25px;}
.opentable form  div dl dt#OT_timeLbl { background:url(/images/ico-time.png) no-repeat left center; display: block;
 float: left;  height: 25px; text-indent: -100000px; width: 25px;}
.opentable form  div dl dd#OT_date input iframe,
.opentable form  div dl dd#OT_date div#cal1.imgCal {display:none !important;}
html.js body div#ui-datepicker-div.ui-datepicker  {display:none; z-index:99999999999999999999999999999999 !important; font-size: 11px;}
html.js body div#ui-datepicker-div.ui-datepicker:focus {position: absolute; z-index:99999999999999999999999999999999 !important; top:0; font-size: 11px;}

.opentable form div dl dd#OT_submitWrap {width:150px;}





/* ******************************************************************** */ 
/*                                 HOME                                 */
/* ******************************************************************** */ 
#pagewidth {clear: both; display: block; margin: 0 auto; position: relative; width: 1080px;} 
#wrapper {border-bottom: 2px solid #413934; display: block; float: left; margin: 10px auto 0; width: 1080px;} 


.slideshow {height: 549px; overflow: hidden; position: relative; width: 100% !important; display:inline-table !important; background:#000000;}
.slideshow .slideWrap article{ text-align: center; background: #333;height: 549px;width: 100% !important;}
.slideshow .slideWrap article .infoSlide{ top: 125px; margin-right: -551px; position: absolute;  right: 50%; text-align: left; width: 366px;  z-index: 999;   }
html.js body section.slideshow div.bx-wrapper div.bx-viewport,
html.js body section.slideshow div.bx-wrapper div.bx-viewport div.slideWrap {position: inherit !important;}
.slideshow .slideWrap article .infoSlide p
{ 
	font-family: 'museo_sans300'; 
	color: #fff; display: 
	inline-block; clear: 
	both;font-size:22px;
	line-height:27px;
}
.slideshow .slideWrap article .infoSlide p strong 
{
	 font-family: 'museo_sans500'; 
	 font-size:24px;
	 line-height:27px;
}
.slideshow .bx-controls { bottom: 10%; margin-right: -545px; position: absolute; right: 50%; width: 360px; z-index: 9999;-webkit-transition: all 0.1s linear;  -moz-transition: all 0.1s linear;  -o-transition: all 0.1s linear;  transition: all 0.1s linear;}
.bx-pager-item a { background-color: #936e54; display: block; float: left; height: 15px; margin: 0 7px 0 0; overflow: hidden; padding: 0; width: 15px; text-indent:-200px; -webkit-border-radius: 10px; -moz-border-radius: 10px; border-radius: 10px; }
.bx-pager-item a.active,
.bx-pager-item a:hover { background-color: #00ABC7;}


.pod-home {display:block; float: left; margin:0 10px 20px 0; padding:0px; width:353px; height:240px; background:#ccc; text-decoration:none; webkit-transition: all 0.3s linear;  -moz-transition: all 0.3s linear;  -o-transition: all 0.3s linear;  transition: all 0.3s linear; filter: alpha(opacity=100); opacity: 1;}
a.pod-home:hover {webkit-transition: all 0.3s linear;  -moz-transition: all 0.3s linear;  -o-transition: all 0.3s linear;  transition: all 0.3s linear; filter: alpha(opacity=90); opacity: 0.9;}
.pod-home h3 { display:block; clear:both; border-bottom: solid 1px #c2620e; font-family: 'charis_silbold_italic'; color:#fff; margin:10px 20px 20px; padding:0 0 10px 0; font-size:22px;}
.pod-home h4
{ 
	display:block; 
	float:right; 
/*	font-family: 'charis_silbold_italic'; */
	font-family: Helvetica, "Trebuchet MS", Arial, sans-serif;
	width:109px; 
	color:#fff; 
	margin: 60px 15px 20px 15px; 
	font-size:16px; 
	line-height:16px;
}
.pod-home h4 strong 
{ 
	clear: both; 
	display: inline-block; 
/*	font-family: 'charis_silitalic';  */
	font-family: Helvetica, "Trebuchet MS", Arial, sans-serif;
	font-size: 18px; 
	line-height: 18px; 
	margin: 0 0 7px; 
	padding: 0; 
	width: 100%;
}

.infoSlide p a { color:#00ABC7; text-decoration:none;}
.infoSlide p a:hover { color:#00ABC7; text-decoration:underline;}


.pod-home input[type='text'] {display:block; clear:both; border: solid 1px #c2620e; margin:20px 20px 7px 20px; -webkit-border-radius: 4px; -moz-border-radius: 4px; border-radius: 4px;  padding:10px 10px 10px 40px;  width: 262px; font-family: 'museo_sans300'; color:#333; font-size:12px; background: url(/images/ico-news.jpg) no-repeat 11px 11px #fff; }
.pod-home input[type='button'] {display:block; float:right; border: none; margin:0 20px 20px 20px; padding:0;  width: 86px; font-family: 'charis_silbold_italic'; color:#00ABC7; font-size:12px; background: url(/images/btn-news.png) no-repeat top left; cursor:pointer; filter: alpha(opacity=100); opacity: 1;}
.pod-home input[type='button']:hover {filter: alpha(opacity=90); opacity: 0.9;}

/*.pod-home.promo1 { background: url(../images/pod-home02-Join-Mailing-List.jpg) no-repeat left top;} */
/*.pod-home.promo1 { background: url(../images/promos/MDG-Banner.jpg) no-repeat left top;}*/
/*.pod-home.promo1 { background: url(../images/promos/pod-patio.jpg) no-repeat left top;}*/
.pod-home.promo1 { background: url(../promos/restaurant-week/button.jpg) no-repeat left top;}
.pod-home.promo2 { background: url(../promos/state-of-mind/banner.jpg) no-repeat left top;}
/*.pod-home.promo3 { background: url(../images/promos/menu-teaser.jpg) no-repeat left top;}*/
.pod-home.promo3 { background: url(../promos/burgers-and-brews/button.jpg) no-repeat left top;}
.pod-home.promo4 { background: url(../images/pod-home-giftcard-options.jpg) no-repeat left top;}


/* ******************************************************************** */ 
/*                                INSIDE                                */
/* ******************************************************************** */ 
#pagewidth-inside {position:relative; display: table; clear:both; width:100%; background:url(/images/bg-pagewidth.jpg) no-repeat top center #000; padding:50px 0 30px 0; overflow:hidden;} 
#wrapper-inside {display: table; overflow:auto; clear:both;  width:1100px; margin:0 auto; padding:0; background:url(/images/bg-wrapper.jpg) repeat-y 381px;} 
#twocols {width:750px;  float:right;  position:relative; }
#maincol {float: left; position: relative;  width:23px;  }
#rightcol {width: 668px;  float:right; padding:20px; margin-right:10px; position:relative; min-height: 500px;}

#rightcol h1 { display:block; float:left; width:100%; font-family: 'HelveticaNeueLT57CnRegular'; font-size:25px; color:#4c2f1b; padding:0; margin:0 0 30px 0;}
#rightcol h2 { display:block; float:left; width:100%; font-family: 'HelveticaNeueLT57CnRegular'; font-size:22px; color:#00ABC7; padding:0 0 10px 0; margin:0 0 30px 0; border-bottom: solid 2px #00ABC7; text-transform:uppercase;}
#rightcol h2 span { display:block; float:left; width:100%; font-family: 'HelveticaNeueLT57CnRegular'; font-size:14px; color:#4C2F1B; padding:0; margin:0;}
#rightcol h3 { display:block; float:left; width:100%; font-family: 'HelveticaNeueLT57CnRegular'; font-size:22px; color:#4c2f1b; padding:0; margin:0 0 30px 0;}
#rightcol h3 span{ display:block; float:left; width:100%; font-family: 'HelveticaNeueLT57CnRegular'; font-size:18px; color:#4c2f1b; padding:0; margin:0; font-style:italic;}
#rightcol h4 { display:block; float:left; width:100%; font-family: 'HelveticaNeueLT57CnRegular'; font-size:18px; color:#00ABC7; padding:10px 0; margin:0 0 10px 0; border-top: solid 1px #00ABC7; border-bottom: solid 1px #00ABC7;}

#rightcol h5 { 
	display:block; 
	float:left; 
	width:100%; 
	font-family: 'HelveticaNeueLT57CnRegular'; 
	font-size:14px; 
	color:#00ABC7; 
	padding:0; 
	margin:10px 0 0 0; 
	text-transform:uppercase;
}

#rightcol h6 { display:block; float:left; width:100%; font-family: 'HelveticaNeueLT57CnRegular'; font-size:14px; color:#4c2f1b; padding:0; margin:0 0 10px 0; text-transform:uppercase;}

#rightcol ul { display:block; float:left; width:100%; padding:0; margin:0 0 30px 0;}
#rightcol ul li { 
	display:block; 
	clear:both;  
	padding: 1% 0 1% 3%; 
	width: 97%; 
	margin:0; 
	font-family: 'HelveticaNeueLT57CnRegular'; 
	font-size:16px; 
	color:#000; 
	border-bottom: dotted 1px #666; 
	background:url(/images/bullet.png) no-repeat center left;
	letter-spacing: 1px;
}

#rightcol p { 
	display:block; 
	float:left; 
	width:100%; 
	font-family: 'HelveticaNeueLT57CnRegular'; 
	font-size:16px; 
	color:#000; 
	  /* padding:0; */
	margin:0 0 20px 0;
}
#rightcol p a { color:#00ABC7; text-decoration:none;}
#rightcol p a:hover { color:#00ABC7; text-decoration:underline;}

#contact-form input[type='text'] {display:block; clear:both; border: solid 1px #c2620e; margin:15px 15px 0 0; -webkit-border-radius: 4px; -moz-border-radius: 4px; border-radius: 4px;  padding:10px;  width: 300px; font-family: 'museo_sans300'; color:#333; font-size:12px; background: #fff; }
#contact-form textarea {display:block; clear:both; border: solid 1px #c2620e; margin:15px 15px 0 0; -webkit-border-radius: 4px; -moz-border-radius: 4px; border-radius: 4px;  padding:10px;  width: 641px; font-family: 'museo_sans300'; color:#333; font-size:12px; background: #fff; min-height:200px; }
#contact-form p { display:block; clear:both; font-family: 'HelveticaNeueLT57CnRegular'; font-size:14px; color:#4c2f1b; padding:0; margin:20px 0 10px 0; text-transform:uppercase;}
#contact-form input[type='button'] {display:block; float:right; border: none; margin:15px; padding:0;  width: 86px; font-family: 'charis_silbold_italic'; color:#00ABC7; font-size:14px; background: url(/images/btn-news.png) no-repeat top left; cursor:pointer; filter: alpha(opacity=100); opacity: 1;}
#contact-form input[type='button']:hover {filter: alpha(opacity=80); opacity: 0.8;}

ul li a {
    color: #351c07;
}

ul li a:hover {
    color: #00ABC7;
	text-decoration:none;
}

 
/* ******************************************************************** */ 
/*                                SIDEBAR                               */
/* ******************************************************************** */ 
#leftcol {width:350px;  float:left;  position:relative; } 

.submenu { display:block; float:left; width:276px; min-height:100px; padding:20px 35px 20px 30px; background:url(/images/bg-submenu.png) no-repeat left top; position:relative; margin: 0 0 20px 10px;}
.submenu ul { display:block; float:left; width:100%; padding:0; margin:26px 0 0;} 
.submenu ul li { display:block; float:left; width:100%; padding:0; margin:0px; list-style-type: none; font-family: 'HelveticaNeueLT57CnRegular'; font-size:15px;} 
.submenu ul li a { display:block; clear:both; padding:10px 7px; margin:0px; border-bottom: solid 1px #fff; color:#fff; text-decoration: none;}
.submenu ul li a:hover 
{ 
	background:#008EA8;
}

.submenu ul li a.current {
    background-color: #311724;
}

.submenu span { display:block; float:left; width:276px; font-family: 'HelveticaNeueLT57CnRegular'; font-size:24px; color:#000000; text-transform:uppercase;} 
.submenu span strong { font-family: 'HelveticaNeueLT57CnRegular'; font-weight:bold; }

.adress { display: block; float: left; margin: 0 0 0 12px; padding: 0;}
.adress span{ color: #FFFFFF; display: block; float: left; font-family: 'HelveticaNeueLT57CnRegular'; font-size: 20px; margin: 0 0 10px;  padding: 0 0 10px; text-transform: uppercase; width: 100%;}
.adress strong{ display:block; float:left; width:100%; font-family: 'HelveticaNeueLT57CnRegular'; font-size:26px; color:#fff; padding:0 0 10px 0; margin:0 0 30px 0; border-bottom: solid 2px #fff; text-transform:uppercase;}

.hour { display: block; float: left; margin: 0 0 0 12px; padding: 0;}
.hour span{ color: #00ABC7; display: block; float: left; font-family: 'HelveticaNeueLT57CnRegular'; font-size: 20px; margin: 0;  padding: 0 0 10px; text-transform: uppercase; width: 100%;}
.hour p{ display:block; float:left; width:100%; font-family: 'HelveticaNeueLT57CnRegular'; font-size:16px; color:#fff; padding:0 0 10px 0; margin:0 0 10px 0;}


#leftcol figure { display: block; float: left; margin: 0 0 10px 22px; overflow: hidden; width: 314px;}  
#leftcol figure img { display: block; float: left; width: 100%;} 



/* ******************************************************************** */ 
/*                                FOOTER                                */
/* ******************************************************************** */  
#footer-content {position:relative; clear:both; display:block; width:100%; background-color:#FFFFFF;} 
.footer {clear:both; display:block; height:58px; width:1080px; margin:0 auto;} 
.footer a.logo-mini {display:block; float: left; margin:0; padding:0;} 
.footer a.logo-club {display:block; float: right; margin:0; padding:0;} 

.foot-menu {display:block; float:left; margin:23px 0 0 85px; padding:0;}
.foot-menu ul {display:block; margin:0 auto; padding:0;}
.foot-menu ul li {display:block; float:left; margin:0; padding:0 15px; font-family: 'HelveticaNeueLT57CnRegular'; font-size:14px; border-right: solid 1px #351c07;}
.foot-menu ul li:last-child {border: none;}
.foot-menu ul li a {color:#351c07; text-decoration: none;}
.foot-menu ul li a:hover {color:#00ABC7; text-decoration: none;}

 
 
/* ******************************************************************** */ 
/*                      printer styles                                  */ 
/* ******************************************************************** */ 
     
@media print{ 
	/*hide the left column when printing*/ 
	#leftcol{display:none;} 
	
	/*hide the right column when printing*/ 
	#rightcol{display:none;} 
	#twocols, #maincol{width:100%; float:none;}
}



#rightcol h4 a {
	color: #00abc7;
	text-decoration:none;
}

#rightcol h4 a:link {
	color: #00abc7;
	text-decoration:none;
}

#rightcol h4 a:active {
	color: #00abc7;
	text-decoration:none;
}

#rightcol h4 a:hover {
	color: #00abc7;
	text-decoration:underline;
}

