function process(num,cal) {

	if(num == -1) {
		if(OTmonth == 0) {
			OTmonth = 11;
			OTyear--;
			OTtoday.setFullYear(OTyear);
		}
		else { OTmonth--; }
	}
	if(num == 1) {
		if(OTmonth == 11) {
			OTmonth = 0;
			OTyear++;
			OTtoday.setFullYear(OTyear);
		}
		else { OTmonth++; }
	}
	// month set twice for bug #10002
	OTtoday.setMonth(OTmonth);
	OTtoday.setMonth(OTmonth);
	writeCalendar(cal);
}

function returnMonth(thismonth,thisYear) {

	MonthDayOrder = "[Month] [Year]";

	monthArray = new Array(
		"Jan", 
		"Feb", 
		"Mar", 
		"Apr", 
